import About from './components/about';
import Dashboard from './components/dashboard';
import Phones from './components/product_list';
import { Router, Routes, Route, BrowserRouter } from 'react-router-dom';
import Teams from './pages/teams';
import Incentives from './components/incentives';
import Nav from './components/nav';
import Projects from './pages/projects';
import { useEffect, useState } from 'react';
import Services from './components/services';
import Brand from './components/brand';


function App() {
  const [phones, setphones] = useState([]);
  // useEffect(() => {
  //    fetch('http://127.0.0.1:8000/phone/', {
  //     method: 'GET',
  //     headers: {
  //       'Content-Type': 'application/json'
  //     }
  //    })
  //       .then(resp => resp.json())
  //       .then(resp => setphones(resp))
  //       .catch(error => console.log(error));
  // }, []);
  useEffect(() => {
    const fetchPost = async () => {
       const response = await fetch(
          'phone/'
       );
       const data = await response.json();
       console.log(data);
       setPosts(data);
    };
    fetchPost();
 }, []);

return (
  <>
      <BrowserRouter>
      <Nav />
      <Routes>
        <Route path='teams' element={<Teams />} />
        <Route path='projects' element={<Projects />} />
      </Routes>
      </BrowserRouter>
        <Dashboard />
        <Incentives />
        <div class="max-w-7xl mx-auto px-4 m-5 sm:px-6 lg:px-8">
          <Brand />
        </div>
    <div className="m-5 max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
      <div>
        <Phones phones={phones} />
      </div>
    </div>
     <About />
     </>
  );
};

export default App;
